export const increment = () => {
    return {
        type: 'INCREMENT'
    };
};

export const decrement = () => {
    return {
        type: 'DECREMENT'
    };
};

export const incrementBy = (state, action) => {
    return {
        type: 'INCREMENTBY5',
        payload: action.payload
    };
};
